	["60071_1"]=[[{60071,1,"天赋异禀",60071,2,1,"使召唤兽有<color='#ffff00'>较大几率</color>随机习得一个<color='#ffff00'>天生技能</color>，已经拥有的天生技能除外\n<color='#00ff00'>（天生技能可在宠物图鉴中查看）</color>"}]],
