	["60073_1"]=[[{60073,1,"腾云突击",60073,2,1,"<color='#00ff00'>物理单攻技能</color>\n脚踩腾云攻向敌方单体，如果速度高于目标，将额外<color='#ffff00'>多攻击一次</color>，当速度低于目标，攻击后速度提升<color='#ffff00'>30%</color>（使用此技能不能触发连击）"}]],
