	["60085_1"]=[[{60085,1,"禁锢旋风",60085,2,1,"<color='#00ff00'>物理近战技，可触发暴击、追击</color>\n对目标造成破甲一击，使其受到<color='#ffff00'>伤害加深20%</color>，并有一定几率<color='#ffff00'>禁锢</color>目标<color='#ffff00'>2</color>回合（<color='#ffff00'>敏捷越高</color>禁锢成功率越高，对<color='#ffff00'>玩家角色</color>控制成功率减半）\n<color='#00ff00'>注：3.5敏/级以上可达最高成功率</color>"}]],
